import axios from "axios";
import { useState } from "react";

const Chat = () => {
    const [data, setData] = useState([]);

    axios
        .get ('https://itunes.apple.com/us/rss/topalbums/limit=100/json',)
        .then((res) => {
            setData(res.data.feed.entry)
            // console.log(res.data.feed.entry)
        })
        .catch((err) => {
            console.log(err)
        })
    // const getChat = () => {

    // }
    return(
        <div className="chat">
            {data && data.map((music) => {
                return(
                    <div>{music}</div>
                )
            })}
        </div>
    )
}

export default Chat;
